const pageConfig = {
    title: 'Product Management',
    apiUrl: '/api/products',
    fields: [
      { name: 'name', label: 'Product Name', type: 'text' },
      { name: 'price', label: 'Price', type: 'number' },
    ],
    permissions: {
      view: 'view_product',
      add: 'add_product',
      edit: 'edit_product',
      delete: 'delete_product',
    }
  };
  
  export default pageConfig;
